import { styled } from "styled-components";

const DetailInfoContainer = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  grid-column-gap: 10vw;

`

const DetailInfoBox = styled.div`

`

const InfoText = styled.p`
  color: #000;
  font-family: Inter;
  font-size: 3vw;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
`

const InfoDetailText = styled.p`
  color: #626682;
  font-family: Inter;
  font-size: 2vw;
  font-style: normal;
  font-weight: 700;
  line-height: 170%; /* 2.125rem */
`

export default function DetailInfoComponent() {
  return (
    <DetailInfoContainer>
      <DetailInfoBox>
        <InfoText>EDUCATION</InfoText>
        <InfoDetailText>한성대학교 컴퓨터공학부<br/>2023.03 ~ 재학 중</InfoDetailText>
      </DetailInfoBox>
      <DetailInfoBox>
        <InfoText>SKILLS</InfoText>
        <InfoDetailText>HTMl / CSS / Javascript<br/>React.js / Next.js</InfoDetailText>
      </DetailInfoBox>
      <DetailInfoBox>
        <InfoText>WORK</InfoText>
      </DetailInfoBox>
      <DetailInfoBox>
        <InfoText>ACTIVITIES</InfoText>
      </DetailInfoBox>
    </DetailInfoContainer>
  )
}
